import store from '../store';
import { useEffect } from "react";
import { useSelector, useDispatch } from 'react-redux'
import { changeIsLogged } from '../slice'

export const fetchProfile = async (event) => {
    console.log('FetchProfileeeee');
    try {
        const rawResponse = await fetch('http://localhost:3001/user/login', {
            method: 'POST',
            body: JSON.stringify({
                email: '',
                password: '',
            })
        });

        console.log('RAW RESPONSE ==> ', rawResponse);
        
        const content = await rawResponse.json();

        console.log('CONTENT ==> ', content);
    } catch (error) {
     }
};


const Form = () => {
    const isLogged = useSelector((state) => state.login.isLogged)
    const dispatch = useDispatch();

    return (
        <div>
            <div className="input-wrapper">
                <label htmlFor="username">Username</label><input type="text" id="username" />
            </div>
            <div className="input-wrapper">
                <label htmlFor="password">Password</label><input type="password" id="password" />
            </div>
            <div className="input-remember">
                <input type="checkbox" id="remember-me" /><label htmlFor="remember-me"
                >Remember me</label>
            </div>
            {/* <a href="./user.html" className="sign-in-button">Sign In</a> */}
            <button className="sign-in-button" onClick={() => fetchProfile()} >Sign In</button>
        </div>
    );
};

export default Form;
